	"plants/tagger/ui/view/fragments/taxonomy/DetailTaxonomyImages.fragment.xml":'<core:FragmentDefinition\r\n\txmlns="sap.m"\r\n\txmlns:core="sap.ui.core"><HBox \r\n\t\titems="{taxon>images}"\r\n\t\twrap="Wrap"><VBox\r\n\t\t\tclass="sapUiTinyMarginEnd"><Image\r\n\t\t\t\tsrc="{\r\n\t\t\t\t\t\tpath: \'taxon>filename\',\r\n\t\t\t\t\t\tformatter: \'.formatter.getSrcImage120px\'\r\n\t\t\t\t\t\t}"\t\r\n\t\t    \twidth="120px"><detailBox><LightBox><LightBoxItem \r\n\t\t\t\t\t\t\timageSrc="{\r\n\t\t\t\t\t\t\t\t\tpath: \'taxon>filename\',\r\n\t\t\t\t\t\t\t\t\tformatter: \'.formatter.getSrcImage\'\r\n\t\t\t\t\t\t\t\t\t}"\r\n\t\t\t\t\t\t\talt="{taxon>name}"\r\n\t\t\t\t\t\t\ttitle="{taxon>name}"\r\n\t\t\t\t\t\t\tsubtitle="{taxon>description}"></LightBoxItem></LightBox></detailBox></Image><Label\r\n\t\t\t\twidth="120px"\r\n\t\t\t\ttooltip="{taxon>description}"\r\n\t\t\t\ttext="{taxon>description}"\r\n\t\t\t\tvisible="{= !${status>/details_editable} }"/><HBox\r\n\t\t\t\tvisible="{status>/details_editable}"><TextArea\r\n\t\t\t\t\tclass="sapUiTinyMarginEnd"\r\n\t\t\t\t\twidth="100px"\r\n\t\t\t\t\ttooltip="{taxon>description}"\r\n\t\t\t\t\tvalue="{taxon>description}"/><core:Icon \r\n\t\t\t\t\tsrc="sap-icon://delete"\r\n\t\t\t    \tsize="1rem"\r\n\t\t\t    \tcolor="#000000" \r\n\t\t\t    \thoverColor="red"\r\n\t\t\t    \tactiveColor="red"\r\n\t\t\t    \ttooltip="Unassign Image"\r\n\t\t\t    \tpress=".ImageToTaxon.onIconPressUnassignImageFromTaxon"><core:layoutData><FlexItemData growFactor="1" /></core:layoutData></core:Icon></HBox></VBox></HBox></core:FragmentDefinition>',
	"plants/tagger/ui/view/fragments/taxonomy/DetailTaxonomyMap.fragment.xml":'<core:FragmentDefinition\r\n\txmlns="sap.m"\r\n\txmlns:core="sap.ui.core"\r\n\txmlns:map="custom.map"><Dialog \r\n\t\tid="dialogLeafletMap"\r\n\t\ttitle="{taxon>genus} {taxon>species}"\r\n    \tstretch="{device>/system/phone}"\r\n\t\tafterClose=".TaxonomyUtil.afterCloseLeafletMap"><content><HBox><VBox\r\n\t\t\t\t\tclass="sapUiTinyMarginEnd"><map:LeafletMap \r\n\t\t\t\t\t\tid="map" \r\n\t\t\t\t\t\twidth="{= (${device>/system/phone}) ? 320 : 1200 }px" \r\n\t\t\t\t\t\theight="{= (${device>/system/phone}) ? 300 : 700 }px" \r\n\t\t\t\t\t\tdefaultZoomLevel="5" \r\n\t\t\t\t\t\tautoZoom="true" \r\n\t\t\t\t\t\tautoPanToSelectedAreas="true"\r\n\t\t\t\t\t\tdrawOpenStreetMap="true" \r\n\t\t\t\t\t\tdrawGeoJsonMap="false" \r\n\t\t\t\t\t\tgeoJsonUrl="./custom/map/level3.geojson" \r\n\t\t\t\t\t\tgeoJsonHighlights="{taxon>distribution/native}"\r\n\t\t\t\t\t\thighlightColor="#ff7800" \r\n\t\t\t\t\t\tpermanentTooltips="true" \r\n\t\t\t\t\t\ttemplateUrl="{localConfig>/leafletMap/templateUrl}"\r\n\t\t\t\t\t\tattribution="{localConfig>/leafletMap/attribution}"></map:LeafletMap></VBox></HBox></content><endButton><Button\r\n\t\t\t\ttext="Close"\r\n\t\t\t\tpress=".TaxonomyUtil.onCloseLeafletMap"/></endButton></Dialog></core:FragmentDefinition>',
	"plants/tagger/ui/view/fragments/taxonomy/DetailTaxonomyOccurrenceImages.fragment.xml":'<core:FragmentDefinition\r\n\txmlns="sap.m"\r\n\txmlns:core="sap.ui.core"><Carousel\r\n\t\tpages="{taxon>occurrenceImages}"\r\n\t\tclass="sapUiNoContentPadding"\r\n\t\tshowPageIndicator="false"><customLayout><CarouselLayout visiblePagesCount="5" /></customLayout><pages><VBox\r\n\t\t\t\tclass="sapUiTinyMarginEnd"><Image\r\n\t\t\t\t\tsrc="{\r\n\t\t\t\t\t\tparts: [\r\n\t\t\t\t\t\t\t{path:\'taxon>gbif_id\'},\r\n\t\t\t\t\t\t\t{path:\'taxon>occurrence_id\'},\r\n\t\t\t\t\t\t\t{path:\'taxon>img_no\'}\r\n\t\t\t\t\t\t\t],\r\n\t\t\t\t\t\t\tformatter: \'.formatter.getSrcImageOccurrenceThumbnail\'\r\n\t\t\t\t\t\t\t}"\r\n\t\t\t\t\ttooltip="{taxon>scientificName}, {taxon>verbatimLocality}"\r\n\t\t\t\t\twidth="220px"><detailBox><LightBox><LightBoxItem \r\n\t\t\t\t\t\t\t\timageSrc="{taxon>href}"\r\n\t\t\t\t\t\t\t\talt="{taxon>verbatimLocality}, {taxon>creatorIdentifier}"\r\n\t\t\t\t\t\t\t\ttitle="{taxon>scientificName} ({taxon>date})"\r\n\t\t\t\t\t\t\t\ttooltip="{taxon>verbatimLocality}, {taxon>creatorIdentifier}"\r\n\t\t\t\t\t\t\t\tsubtitle="{taxon>verbatimLocality}, {taxon>creatorIdentifier}"></LightBoxItem></LightBox></detailBox></Image><Link\r\n\t\t\t\t\ttext="{taxon>verbatimLocality}, {taxon>creatorIdentifier}"\r\n\t\t\t\t\ttooltip="{taxon>verbatimLocality}, {taxon>creatorIdentifier}"\r\n\t\t\t\t\twidth="220px"\r\n\t\t\t\t\tsubtle="true"\r\n\t\t\t\t\twrapping="true"\r\n\t\t\t\t\thref="{taxon>references}"\r\n\t\t\t\t\ttarget="_blank"\r\n\t\t\t\t\t/></VBox></pages></Carousel></core:FragmentDefinition>'
